import React from 'react';
import { Card, CardContent, Typography } from "@material-ui/core";


function InfoBox({ title, cases, total, }) {
    return (
        <Card>
            <CardContent>
                {/*Title */}
                <Typography color="textSecondary">
                    {title}
                </Typography>

                {/*Number of cases */}
                <h2>{cases}</h2>

                {/* 1.2m Total */}
                <Typography color="textSecondary">
                    {total} Total
                </Typography>
            </CardContent>
        </Card>
    )
}

export default InfoBox
